import "./App.css";
import { useEffect, useState } from 'react';
import { Spinner } from "react-bootstrap";

function App() {
  const [locations, setLocations] = useState([]);

  useEffect(() => {
    fetch('/data/getMenu')
      .then((res) => res.json())
      .then((data) => {
        const locs = data.map((el) => {
          return el.Location
        }).sort()
        setLocations(locs)
      });
  }, [])

